import React, { Component } from 'react';

class TodoList extends Component{

    constructor(props) {
        super(props);
        this.state = {
            userInput: '',
            items :[]

        };
    }


    render(){
        return(
            <div>
                <h1>Ma Tod List </h1>
                <form>
                    <input
                        value={this.state.userInput}
                        type="text"
                        placeholder="Renseigner un item"/>
                    <button>Ajouter</button>
                </form>
            </div>
        )
    }

}

export default TodoList;
